  methods: {
  	getprofile : function (){
  		var myStorage = window.localStorage 
  		
  		this.$http.get( API.PROFILE+myStorage.getItem('UID')).then((response) => {
	       //success
			this.profile = response.body
	    }, (response) => {
	      //error
	      alert(response.body.error.message)
	    });
  	}
  },
  created: function () {
  	this.getprofile();
  }
}
</script>

